import React from "react"

import * as images from "./images"
import "./Maze.css"


function randomNumber(max = 21){
  return Math.floor(Math.random() * Math.floor(max));
}

function lol(ligne){
  if(ligne[1][randomNumber()].passable){
    return(
      <img src={images.floor} alt="" />
    )
  }
}


function Maze({ maze }) {
  return (
    <div className="Maze">
      {maze.tiles.map(row => (
        <div className="Maze-row">
          {row.map(cell => (
            <img src={cell.passable ? images.floor : images.wall} alt="" />
          ))}
        </div>
      ))}
    </div>
  )
}

export default Maze
